import React, {Component} from 'react';

class Search extends Component {
    // displayButton = () => {
    //     if(this.props.status){
    //         return <div className="btn btn-success btn-block add" onClick={() =>this.props.status}>Đóng lại</div>
    //     }
    //     return <div className="btn btn-success btn-block add" onClick={() =>this.props.status}>Thêm mới</div>
    // };
    render() {
        return (
            <div>
                <div className="col-12">
                    <div className="form-group">
                        <div className="btn-group">
                            <input
                                className="form-control"
                                type="text"
                                name="seach"
                                placeholder="Nhập từ khoá"
                            />
                            <button className="btn btn-primary">Tìm</button>
                            <div className="btn btn-success btn-block add" onClick={() => this.props.status}>Đóng lại</div>
                            <div className="btn btn-success btn-block add" onClick={() => this.props.status}>Thêm mới</div>
                        </div>

                    </div>
                </div>
            </div>
        );
    }
}

export default Search;
